import Header from "../../Components/Header/Header.js";
import Intro from "../../Components/Intro/Intro.js";
//import LineGraph from "../../Components/ChartJs/Charts.js";
//import ChipsArray from "../../Components/Chip/Chips.js";
//import { makeStyles } from '@material-ui/core/styles';
import Parallax from "C:/NewReactResume/resm/src/Components/Parallax/Parallax.js";
//import ProfileTab from "../../Components/ProfilePortion/ProfileTab.js";
import Graphing from "../../Components/Graphs/Graphing.js";
//import SimpleTable from "../../Components/Tables/Tables.js";
//import CustomLinearProgress from "../../Components/LinearProgress/LinearProgress.js";
//import NewMl from "../../Components/FirstML/NewML.js";
//import Toxicity1 from "../../Components/FirstML/Toxic.js";
//import AnotherMl from "../../Components/FirstML/AnotherMl.js";
import HorizontalLinearStepper from '../../Components/Stepper/Stepper.js'
//import Play from '../../Components/PlayGround/PlayGround.js'
//import imag1 from "../../assets/img/isaac-quesada-MspsNfWf3q8-unsplash.jpg";
import imag2 from "../../assets/img/logom.png"
import Container from '@material-ui/core/Container/Container.js'
//import StoreVals from '../../Components/StoreVals/StoreVals.js'
//import AnotherMl from "../../Components/FirstML/AnotherMl.js";
//import AnotherMl_2 from "../../Components/FirstML/AnotherMl_2.js";
//import SimpleMediaQuery from '../../Components/MediaQuer/SimpleMedia.js'
import useMediaQuery from '@material-ui/core/useMediaQuery';
//import PComp from '../../Components/p5ML/P5Comp.js'
//import styles from "../assets/jss/material-kit-react/views/components.js";
import Instr from '../../Components/WelcomeGame/PlayInstructions.js'
//const useStyles = makeStyles();
//const useStyles = makeStyles(styles);
/**
 * This Class Represets the Root of the App Components
 * 
 * 
 * * */

export default function Components() {
  const matches = useMediaQuery('(min-width : 1300px)');

//const classes = useStyles();
  return (
    <span>

      {
        matches
      ?
      <div>
          <Container>
            <Header/>
            <h4>Greeting depending on time of day</h4>
            <Parallax image={imag2} />
            <Intro />
            <Instr />
            
            <HorizontalLinearStepper />
            
          </Container>
          
          </div>
          
        :
          <div>
          <h1>
            Sorry, Page only Viewable on Desktops/Laptops
            Tablets, need be flipped.
          </h1>
          </div>
          }
    </span>
  );
}
